CREATE TABLE basic(
   place_id            VARCHAR(27) NOT NULL PRIMARY KEY
  ,name                VARCHAR(32) NOT NULL
  ,address             VARCHAR(93) NOT NULL
  ,lat                 VARCHAR(17) NOT NULL
  ,lng                 NUMERIC(11,7) NOT NULL
  ,rating              NUMERIC(3,1) NOT NULL
  ,rating_total        NUMERIC(6,1) NOT NULL
  ,zipcode             INTEGER  NOT NULL
  ,weekday             VARCHAR(652) NOT NULL
  ,Total_Business_Hour NUMERIC(5,2) NOT NULL
);
